import React from 'react'
import { Button, Input } from 'antd'
import { SearchOutlined } from '@ant-design/icons'
const SearchButton = (props) => {
   const {size, placeholder, labelButton} = props
   return (
      <div style={{display: 'flex'}}>
            <Input bordered="false" prefix={<SearchOutlined/>} size={size} placeholder={placeholder} style={{borderRadius: '6px 0px 0px 6px'}}/>
            <Button style={{background:'#00B207', color:'white',borderRadius: '0px 6px 6px 0px'}} size={size} >{labelButton}</Button>
      </div>
   )
}

export default SearchButton
